import React, { useState } from "react";
import { motion } from "framer-motion";
import LoginForm from "./LoginForm";
import axios from "axios";

export default function RegisterForm(props) {
	const [isUser, setIsUser] = useState({ username: "", password: "" });

	const handleSubmit = (event) => {
		event.preventDefault();
		axios.post("https://wassup-backend.herokuapp.com/api/v1/auth/signup", {});
	};

	return (
		<motion.div className="register-wrapper">
			<motion.div>
				<h2>Please Register</h2>
			</motion.div>
			<hr />
			<div>
				<form onSubmit={handleSubmit} method="post">
					<input type="text" placeholder="Name" value="name"></input>
					<input type="text" placeholder="Username"></input>
					<input type="password" placeholder="Password"></input>
					<button
						// onClick={setIsUser({ username: "test", password: "test" })}
						type="submit">
						Register
					</button>
				</form>
				<span>
					Already have an account?
					<button onClick={props.hasAccount}>Login Here</button>
				</span>
			</div>
		</motion.div>
	);
}
